import React from "react";
import './categories.css';
import TextPicture from "../textpicture/textpicture";

export default function Categories({menuItems}){
    return(
        <>
            <div class="menu-container">
                <div class="menu-categories-heading">
                    <span class="menu-categories-header">Categories</span>
                    <span class="menu-categories-amount">(12)</span>
                </div>

                <TextPicture text='PASTA' pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img'/>
                <TextPicture text='PIZZA' pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img'/>
                <TextPicture text='BURGERS' pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img'/>
                <TextPicture text='WRAPS' pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img'/>
            </div>
        </>
    )
}
